import {Main,OuterContainer,InnerContainer,HeaderContainer,ItemContainer,FoodContainer} from './components/MainContainer'
import {Header} from './components/Header'
import React from 'react';
import FoodItem from './components/FoodItem';
import FoodList from './components/FoodList';

const data = '[{"title": "Pancake" , "img":"https://images.pexels.com/photos/357573/pexels-photo-357573.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1", "ingredients" : ["fish","aplle","cheese"]},{{"title": "Pizza" , "img":"https://images.pexels.com/photos/315755/pexels-photo-315755.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1", "ingredients" : ["apple","aplle","cheese"]}}]';


function App() {
  return (
    <OuterContainer>       
      <Main>
        <InnerContainer>
          <HeaderContainer>
            <Header />
          </HeaderContainer>
          <FoodContainer>
            <FoodList foods ={data} />
          </FoodContainer>

        </InnerContainer>

      </Main>
    </OuterContainer>


  );
}

export default App;
